import React from 'react';
import './Sidelist.css';
import profilepic from '../../../Images/faithful.jpg';

const Sidelist = ({showProfilePic}) => {
  return (
    <React.Fragment>
        <div className='nav-items'>
            {
                showProfilePic ? (<div className='profilepic'>
                                    <img src={profilepic} alt='profile pic'></img>
                                    <ul>
                                        <li className='nav-item'>Home</li>
                                        <li className='nav-item'>About</li>
                                        <li className='nav-item'>Work Experience</li>
                                        <li className='nav-item'>Tech Stack</li>
                                        <li className='nav-item'>Education</li>
                                        <li className='nav-item'>Projects</li>
                                        <li className='nav-item'></li>
                                        <li className='nav-item'></li>
                                    </ul>
                                </div>) : null
            }
        </div>
    </React.Fragment>
  )
}

export default Sidelist
